items.description:
**Love Story** is an elegant 100% responsive site template with a fashionable and tender look. It’s designed for a wedding planning agency, an individual wedding planner, or any event planning company (parties, meetings, conferences).

Clean design of Love Story is also perfect for any corporate website. Besides that, the template offers a lot of great features:
_**The template offers such features:**_
*Tons of pre-made pages;
*Valid HTML5/CSS3;
*Optimization for search engines;
*Ultra responsive layout;
*Retina readiness;
*Full customization;
*Cross Browser Compatibility: Firefox, Chrome, Safari, Opera and IE;
*Bulletproof consistency
